import { NextApiRequest, NextApiResponse } from 'next'
let csvToJson = require('convert-csv-to-json')

const blog = (req: NextApiRequest, res: NextApiResponse) => {
  let json = csvToJson.getJsonFromCsv('./blogdata.csv')
  res.json(json)
}

export default blog
